import React, { useState } from 'react';
import styled, { keyframes } from 'styled-components';
import { useNavigate } from 'react-router-dom';
import theme from '../styles/theme'; // Caminho para o arquivo do tema

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [isEmailValid, setIsEmailValid] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/api/users/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email, password }),
      });

      if (!response.ok) {
        throw new Error('Error logging in');
      }

      const data = await response.json();
      localStorage.setItem('token', data.token);
      navigate('/tasks');
    } catch (error) {
      console.error('Error logging in:', error);
    }
  };

  const handleEmailChange = (e) => {
    const value = e.target.value;
    setEmail(value);
    // Basic email validation
    setIsEmailValid(/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(value));
  };

  return (
    <Container>
      <Form onSubmit={handleSubmit}>
        <Title>Inicie Sess√£o na Connecter</Title>
        <InputWrapper>
          <InputLabel htmlFor="email">Email</InputLabel>
          <Input
            id="email"
            type="email"
            placeholder=" "
            value={email}
            onChange={handleEmailChange}
          />
        </InputWrapper>
        {isEmailValid && (
          <InputWrapper>
            <InputLabel htmlFor="password">Password</InputLabel>
            <Input
              id="password"
              type="password"
              placeholder=" "
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </InputWrapper>
        )}
        <Button type="submit">Login</Button>
      </Form>
    </Container>
  );
};

const fadeIn = keyframes`
  from {
    opacity: 0;
    transform: translateY(20px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: ${theme.colors.background};
  padding: 1rem;
`;

const Form = styled.form`
  background: #fff;
  padding: 2rem;
  border-radius: 12px;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
  max-width: 400px;
  width: 100%;
  animation: ${fadeIn} 0.6s ease-in-out;
`;

const Title = styled.h2`
  margin-bottom: 1.5rem;
  font-size: 1.75rem;
  color: ${theme.colors.text};
  text-align: center;
  font-weight: 600;
  font-family:
    'San Francisco',
    -apple-system,
    BlinkMacSystemFont,
    'Segoe UI',
    Roboto,
    'Helvetica Neue',
    Arial,
    sans-serif;
`;

const InputWrapper = styled.div`
  position: relative;
  margin-bottom: 1rem;
`;

const InputLabel = styled.label`
  position: absolute;
  top: 50%;
  left: 0.75rem;
  transform: translateY(-50%);
  font-size: 1rem;
  color: #aaa;
  transition: 0.3s ease all;
  pointer-events: none;
  font-family:
    'San Francisco',
    -apple-system,
    BlinkMacSystemFont,
    'Segoe UI',
    Roboto,
    'Helvetica Neue',
    Arial,
    sans-serif;
  background: ${theme.colors.background}; /* Same as input background */
  padding: 0 0.25rem; /* Padding to avoid overlap with input border */
`;

const Input = styled.input`
  width: 100%;
  padding: 1rem 0.75rem;
  padding-top: 1.5rem; /* Ensure space for label when floating */
  border: 1px solid #dcdcdc;
  border-radius: 8px;
  font-size: 1rem;
  font-family:
    'San Francisco',
    -apple-system,
    BlinkMacSystemFont,
    'Segoe UI',
    Roboto,
    'Helvetica Neue',
    Arial,
    sans-serif;
  transition:
    border-color 0.3s,
    box-shadow 0.3s;

  &:focus {
    border-color: #007aff;
    box-shadow: 0 0 0 2px rgba(0, 122, 255, 0.2);
    outline: none;
  }

  &:focus + ${InputLabel}, &:not(:placeholder-shown) + ${InputLabel} {
    top: 0;
    left: 0.75rem;
    font-size: 0.75rem;
    color: #007aff;
    transform: translateY(-50%);
  }
`;

const Button = styled.button`
  width: 100%;
  padding: 0.75rem;
  background: #007aff;
  border: none;
  color: #fff;
  border-radius: 8px;
  cursor: pointer;
  font-size: 1.125rem;
  font-weight: 500;
  font-family:
    'San Francisco',
    -apple-system,
    BlinkMacSystemFont,
    'Segoe UI',
    Roboto,
    'Helvetica Neue',
    Arial,
    sans-serif;
  transition:
    background 0.3s,
    transform 0.3s;

  &:hover {
    background: #0051a8;
    transform: scale(1.02);
  }

  &:active {
    transform: scale(0.98);
  }
`;

export default LoginPage;
